import React, { useState } from 'react';
import { ThemeProvider, CssBaseline } from '@mui/material';
import theme from './theme';
import { BrowserRouter as Router, Routes, Route, Navigate, Link } from 'react-router-dom';
import { AuthProvider, useAuth } from './auth/AuthContext';
import Login from './auth/Login';
import Home from './pages/Home';
import DeviceControl from './pages/DeviceControl';
import SignUp from './pages/SignUp';
import ForgotPassword from './pages/ForgotPassword';
import AdminPanel from './pages/AdminPanel';
import AnalyticsPage from './pages/AnalyticsPage';
import { Box } from '@mui/material';
import Sidebar from './pages/sidebar';
import HistoryPage from './pages/historyPage';
import AppBreadcrumbs from './components/AppBreadcrumbs';


const PrivateRoute = ({ children }) => {
  const { token } = useAuth();
  return token ? <>{children}</> : <Navigate to="/login" />;
};

const MainLayout = ({ children }) => (
  <Box sx={{ display: 'flex', minHeight: '100vh', background: 'transparent !important' }}>
    <Sidebar />
    <Box
      component="main"
      sx={{
        flexGrow: 1,
        p: 0,
        background: 'transparent !important',
        minHeight: '100vh',
        marginLeft: { xs: 0, md: '240px' },
        transition: 'margin-left 0.3s',
      }}
    >
      <Box sx={{ p: { xs: 1, md: 3 }, background: 'transparent !important' }}>
        <AppBreadcrumbs />
        {children}
      </Box>
    </Box>
  </Box>
);


const App = () => (
  <ThemeProvider theme={theme}>
    <CssBaseline />
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/history" element={<PrivateRoute><MainLayout><HistoryPage /></MainLayout></PrivateRoute>} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<SignUp />} />
          <Route path="/forgot-password" element={<ForgotPassword />} />
          <Route path="/" element={<PrivateRoute><MainLayout><Home /></MainLayout></PrivateRoute>} />
          <Route path="/device" element={<PrivateRoute><MainLayout><DeviceControl /></MainLayout></PrivateRoute>} />
          <Route path="/admin" element={<PrivateRoute><MainLayout><AdminPanel /></MainLayout></PrivateRoute>} />
          <Route path="/analytics" element={<PrivateRoute><MainLayout><AnalyticsPage /></MainLayout></PrivateRoute>} />
        </Routes>
      </Router>
    </AuthProvider>
  </ThemeProvider>
);

export default App;
